CREATE DEFINER=`Kevin`@`%` PROCEDURE `UpdateStudentsViaFees`()
BEGIN

DROP TABLE IF EXISTS tmpTbl;

CREATE TEMPORARY TABLE tmpTbl

select S_ID , S_NAME ,  DueDate from 
( 
Select S.S_ID,S.S_NAME,S.S_STATUS,S.S_FEES_STATUS, F.intFeesID,F.intFeesDuration,max(F.DtToDate) as DueDate
from tblStudents S 
inner join tblFees F 
on S.S_ID = F.S_ID
where S.S_STATUS = 'Active' AND S_FEES_STATUS = 'PAID'
group by S_ID
) A
where A.DueDate < CURDATE();


update tblStudents S
inner join tmpTbl T on S.S_ID = T.S_ID
set S.S_FEES_STATUS = 'Fees Due' , S_LASTUPDATED = CURDATE();


END ;;
